DELIMITER $$
CREATE TRIGGER `input` AFTER INSERT ON `users` FOR EACH ROW BEGIN
UPDATE tblstudents
SET tblstudents.Email= new.email
where
tblstudents.RegistrationNo=new.RegistrationNo;
END
$$
